#!/usr/bin/env python3
import binascii
import hexdump
import base64
from pathlib import Path

STARTER_SET_ZIP_DATA = ""

def base64_encode( message ):
	try:
		message_bytes = str( message ).encode( 'utf-8' )
		base64_bytes = base64.b64encode( message_bytes )
		base64_message = base64_bytes.decode( 'utf-8' )
		return base64_message
	except Exception as e:
		print( e )
		return False

def base64_decode( base64_message ):
	try:
		base64_bytes = base64_message.encode( 'utf-8' )
		message_bytes = base64.b64decode(base64_bytes)
		return message_bytes
	except Exception as e:
		print( e )
		return False

# https://stackoverflow.com/q/48209760
def print_file_bytes_as_b64( file_path ):
	with open( file_path , 'rb' ) as f:
		# blob_data = hexdump.hexdump( f , result='return' )
		blob_data = bytearray( f.read() )
		print( base64_encode( blob_data ) )

def generate_starter_set():
	output_file_path = Path.cwd().joinpath( "ppt_interactive_generator_starter.zip" )
	starter_set_bytes = base64_decode( STARTER_SET_ZIP_DATA )
	with open( str( output_file_path ) , 'wb' ) as f:
		# blob_data = hexdump.hexdump( f , result='return' )
		f.write( starter_set_bytes )

